// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import {Library} from "../Library.sol";

contract GatekeeperTwoHelper {
  function delegate(address helper2Addr, address twoAddr, bytes8 param) public {
        (bool success, bytes memory retMsg) = helper2Addr.call(abi.encodeWithSignature("delegate(address,bytes8)",twoAddr, param));
        if(!success) {
            string memory errMsg = Library._getRevertMsg(retMsg);
            require(success, errMsg);
        }
    }
}

contracts/Library.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

library Library {
    function _getRevertMsg(bytes memory _returnData) internal pure returns (string memory) {
        // If the _res length is less than 68, then the transaction failed silently (without a revert message)
        if (_returnData.length < 68) return 'Transaction reverted silently';

        assembly {
            // Slice the sighash.
            _returnData := add(_returnData, 0x04)
        }
        return abi.decode(_returnData, (string)); // All that remains is the revert string
    }
}
